import React from 'react';
import { Play } from 'lucide-react';

const ProgressTracker: React.FC = () => {
  return (
    <div className="text-center py-12">
      <Play className="h-12 w-12 text-gray-400 mx-auto mb-4" />
      <h3 className="text-lg font-medium text-gray-900 mb-2">Progress Tracking</h3>
      <p className="text-gray-600">
        This component will provide real-time progress tracking for normalization processes.
        <br />
        <span className="text-sm text-gray-500">Coming soon in the next iteration.</span>
      </p>
    </div>
  );
};

export default ProgressTracker;
